#100 повторений с массивом в 1000 элементов = 7.261054039001465 ~ 8.07530689239502. Почти с полной оптимизацией.
def sortByBirth(array) :
   array2 = []
   for str in array :
      number = str.split(',')[1]
      array2.append(int(number))
   for i in range(len(array2)) :
      for ind in range(i,len(array2) - 1) :
         if array2[ind] > array2[ind + 1] :
            array2[ind],array2[ind + 1] = array2[ind + 1], array2[ind]
            array[ind],array[ind + 1] = array[ind + 1], array[ind]
   # print(array)
   return array

